Total count and field count with condition in a single MongoDB aggregation pipeline<p>I have a collection of components. Simplified, a document looks like this:</p>
<pre><code>{
    &quot;_id&quot; : &quot;50c4f4f2-68b5-4153-80db-de8fcf716902&quot;,
    &quot;name&quot; : &quot;C156&quot;,
    &quot;posX&quot; : &quot;-136350&quot;,
    &quot;posY&quot; : &quot;-27350&quot;,
    &quot;posZ&quot; : &quot;962&quot;,
    &quot;inspectionIsFailed&quot; : &quot;False&quot;
}
</code></pre>
<p>I would now like to calculate three things. The number of all components in the collection, the number of all faulty components <code>&quot;inspectionIsFailed&quot;: &quot;True&quot;</code> and then the ratio (number of all faulty components divided by the number of all components).
I know how to get the first two things separately and in a row with one aggregation each.</p>
<p>Number of all components:</p>
<pre><code>db.components.aggregate([
    {$group: {_id: null, totalCount: {$sum: 1}}}
]);
</code></pre>
<p>Number of all faulty components:</p>
<pre><code>db.components.aggregate([
    {$match: {inspectionIsFailed: &quot;True&quot;}},
    {$group: {_id: null, failedCount: {$sum: 1}}}
]);
</code></pre>
<p>However, I want to calculate the two values in a single pipeline and not separately. Then I could use $divide to calculate the ratio at the end of the pipeline. My desired output should then only contain the ratio:</p>
<pre><code>{ ratio: 0.2 }
</code></pre>
<p>My problem with a single pipeline is: <br>
If I try to calculate the total number first, then I can no longer calculate the number of the faulty components. If I first calculate the number of faulty components with $match, I can no longer calculate the total number.</p>

