Testing a mongoose schema that has a validation which depends on another schema<p>I have a mongoose schema-<code>WishlistItem</code>, which has a <strong>validation:</strong> A new <code>WishlistItem</code> cannot be created if it's <code>wishlist</code> property(an object id) doesn't belong to a real existing <code>Wishlist</code> in the database. The <code>WishlistItem</code> has this validation so that <code>wishlistItems</code> without parent <code>wishlists</code> aren't accidentally added to the database.</p>
<p>How can I run tests on the <code>WishlistItem</code> model without creating a real <code>wishlist</code>?</p>
<p>I'm using mocha and chai.</p>
<h2>The test to create a wishlistItem</h2>
<p>Currently the test gives:
<code>AssertionError: expected undefined to be an object.</code></p>
<p>This is because <code>await WishlistItem.create({...</code> throws an error:</p>
<p><code>ValidationError: WishlistItem validation failed: wishlist: Invalid WishlistItem &quot;wishlist&quot; property. No wishlist found with id: 5f9480a69c4fcdc78d55397d</code> since we don't have that <code>wishlist</code> in the database.</p>
<pre class="lang-js prettyprint-override"><code>const chai = require('chai');
const mongoose = require('mongoose');


const { expect } = chai;

const dbConnect = async (dsn) =&gt;
  mongoose.connect(dsn, {
    useNewUrlParser: true,
    useUnifiedTopology: true,
    useFindAndModify: false,
  });

const should = chai.should();
const WishlistItem = require('../testsFiles/WishlistItem.Model');

describe('Wishlist Item', () =&gt; {
  before(async () =&gt; {
    dbConnect(`mongodb://127.0.0.1:27017/schemaDepTest`);
  });
  context('create wishlist item', () =&gt; {
    it('should create a wishlist item with valid arguments', async function () {
      let wishlist;
      try {
        wishlist = await WishlistItem.create({
          itemName: 'Purse',
          price: '5.00',
          wishlist: mongoose.Types.ObjectId('5f9480a69c4fcdc78d55397d'),
        });
      } catch (err) {
        console.log(err);
      }
      expect(wishlist).to.be.an('Object');
    });
  });
});

</code></pre>
<h2>WishlistItem Schema</h2>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');

const itemSchema = new mongoose.Schema(
  {
    itemName: { type: String, required: true, trim: true },
    price: { type: String, required: true, trim: true },
    wishlist: {
      type: mongoose.Schema.Types.ObjectId,
      ref: 'Wishlist',
      required: true,
