    throw new Error(
      `Invalid WishlistItem &quot;wishlist&quot; property. No wishlist found with id: ${value}`
    );
  } else {
    return true;
  }
}, 'Parent Wishlist non existent');

const WishlistItem = mongoose.model('WishlistItem', itemSchema);
module.exports = WishlistItem;
</code></pre>
<h2>The Wishlist Schema</h2>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');

