Best way to update value of an object inside mongodb object<p>This is how I store each element in my mongodb collection.</p>
<pre><code>{
  _id: 'iTIBHxAb8',
  title: 'happy birthday',
  votesObject: { happy: 0, birthday: 0 }
}
</code></pre>
<p>I made a very dirty work around which I am not at all proud of which is this...</p>
<pre><code>//queryObject= {id,chosenvalue};
let queryObject = req.query;
let id = Object.keys(queryObject)[0];
let chosenValue = queryObject[id];
db.collection(&quot;voting&quot;)
            .find({ _id: id })
            .toArray((err, data) =&gt; {
                let { votesObject } = data[0];
                votesObject[chosenValue] += 1;
                data[0].votesObject = votesObject;
                db.collection(&quot;voting&quot;).replaceOne({ _id: id }, data[0]);
                res.redirect(&quot;/polls?id=&quot; + id);
            });
</code></pre>
<p>So basically what this does is It gets the chosen value which may be &quot;happy&quot; or the &quot;birthday&quot; from the above example.</p>
<ul>
<li>Finding the complete object from the collection which matches the id.</li>
<li>Incrementing the chosen value from the found object.</li>
<li>Using replaceOne() to replace the previous object with the newly changed object.</li>
</ul>
<p>I am incrementing the value inside chosen value by one everytime this piece of code executes.</p>
<p>This works perfectly fine but I want to know if there is any <strong>way to directly update the chosen value</strong> without all this mess. I could not find a way to do it else where.</p>

